import React from "react";
import {ThemeContext} from './theme-context';

export default class ProfilePage extends React.Component {
    render() {    
        return (
            <div>
                <section>
                    <p><strong>User:</strong> {this.props.user.name} </p>
                </section>
                <section>
                <p><strong>Theme:</strong> {this.props.theme.name} </p>
                </section>
            </div>
        )
    }
}
